import React from 'react';

const Footer = () => {
    return(
        <div id="footer">
            <div>
                Our Dev Team
            </div> 
            <div id="footerMenu">
                Menu
            </div>
            <div id="footerInfo">
                Information
            </div>
        </div>
    )
}

export default Footer;
